(0x018dcafbadaa75e6af690d8c8f4f3c18, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{\"url\": {\"value\": null, \"source\": \"static\"}, \"media\": {\"value\": \"018dcafc398a7144b1bcc7796b5f02de\", \"source\": \"static\"}, \"newTab\": {\"value\": false, \"source\": \"static\"}, \"minHeight\": {\"value\": \"340px\", \"source\": \"static\"}, \"displayMode\": {\"value\": \"standard\", \"source\": \"static\"}, \"verticalAlign\": {\"value\": null, \"source\": \"static\"}, \"horizontalAlign\": {\"value\": null, \"source\": \"static\"}}', NULL, '2024-02-21 09:26:43.246', NULL),
(0x018dcafbadab7850bb0b946aa5530e95, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{\"content\": {\"value\": \"<h1>Inspiration + Passion\\n<br /><span>= Opportunity</span></h1>\\n                <p>Mark Rivard’s vision of art extends far beyond the reach of stretched canvas. With notable works spanning the ESPN X Games to the world of skateboarding, he uses his illustrative craft as a catalyst for inspiring others. Having successfully created art education and therapy programs on a global scale, Mark’s process and practices continue to inspire countless children of varied circumstances all over the world. As a professional artist in skateboarding, his global tours of his skateboard art program touch down in tough neighborhoods and Air Force Bases alike. </p>\", \"source\": \"static\"}, \"verticalAlign\": {\"value\": null, \"source\": \"static\"}}', NULL, '2024-02-21 09:26:43.247', '2024-02-21 09:40:20.674'),
