(0x018dcafd4e2f72bc88fe289c1063600b, 0x0fa91ce3e96a4bc2be4bd9ce752c3425, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{\"content\": {\"value\": \"<div class=\\\"drt-newsletter__text\\\"> Reaching further still, his renowned art platforms aim to help those with special needs, PTSD, and deployed difficulty. Still at large touring the world, Mark continues to broaden the definition and expanse of a residency. </div>\", \"source\": \"static\"}, \"verticalAlign\": {\"value\": null, \"source\": \"static\"}}', NULL, '2024-02-21 09:27:48.674', NULL),
